class UnionFind{

	private int[] par;
	private int[] siz;

	public UnionFind(int n) {
		par = new int[n];
		siz= new int[n];
		Arrays.fill(par, -1);
		Arrays.fill(siz, 1);
	}

	public int root(int x) {
		if(par[x] == -1) return x;
		return par[x] = root(par[x]);
	}

	public boolean same(int x, int y) {
		return root(x) == root(y);
	}

	public int siz(int x) {
		return siz[root(x)];
	}

	public boolean unite(int x, int y) {
		x = root(x);
		y = root(y);

		if(x == y) return false;

		if(siz[x] > siz[y]) {
			int tmp = x;
			x = y;
			y = tmp;
		}

		par[x] = y;
		siz[y] += siz[x];

		return true;
	}
}

